import React from 'react';
import { NavLink } from 'react-router-dom';
import { HeaderTopItems } from './style';
const HeaderTopItem = ({headerTopItem}) => {
  const {name, path, type} = headerTopItem
  return(
    <HeaderTopItems className="head-top-item" type={type}>
      <NavLink exact to={path}>{name}</NavLink>
    </HeaderTopItems>
  );
}
export default HeaderTopItem;
